<script setup lang="ts">
import {invoke} from "@tauri-apps/api/core";
import {open} from '@tauri-apps/plugin-shell'
import config from '../../../package.json'
import {ref} from "vue";

const updateBtnText = ref<string>('检查更新')

const checkUpdate = async () => {
  updateBtnText.value = '检查中...'
  const {status, version} = await invoke('check_update') as { status: boolean, version: string }
  console.log(status, version)
  if (!status) {
    updateBtnText.value = '已经是最新版本'
  } else {
    updateBtnText.value = `发现新版本: ${version}!`
  }

  setTimeout(() => {
    updateBtnText.value = '检查更新'
  }, 5000)
}

const openGithub = async () => {
  await open('https://github.com/zktkzc/tk-tools-tauri')
}
</script>

<template>
  <div class="h-full w-full flex flex-col items-center justify-center">
    <div class="flex items-center justify-center">
      <img
          src="data:image/png;base64,"
          alt=""
          class="w-[100px]"
      />
      <div class="flex flex-col items-center justify-center gap-2 text-black dark:text-white">
        <div class="font-bold text-[20px]">TK工具箱</div>
        <div class="text-[12px]">当前版本:{{ config.version }}</div>
      </div>
    </div>
    <div class="w-[200px] mt-4 flex flex-col items-center justify-center gap-2">
      <el-button class="button-with-bg w-full" @click="checkUpdate">{{ updateBtnText }}</el-button>
      <el-button
          class="button-with-bg w-full dark:bg-[#373737] dark:border-[#373737] dark:hover:bg-[#4F4F4F] dark:hover:border-[#4F4F4F]"
          @click="openGithub"
      >
        Github仓库
      </el-button>
    </div>
  </div>
</template>

